import React from "react";
import PropTypes from "prop-types";
import "antd/dist/antd.css";
const _App = (props) => <h1>asd</h1>;

_App.propTypes = {
  //점검을해주자 점검을하면 서비스의 안전성 ↑
  Component: PropTypes.elementType.isRequired,
};
export default _App;
